  true,\n\t\"url\": null,\n\t\"notes\": \"The State Library Agency Survey (SLAA) provides
  descriptive data about state library agencies for all fifty states and the District
  of Columbia. A state library agency is the official agency of a state that is charged
  by state law with the extension and development of public library services throughout
  the state and that has adequate authority under state law to administer state plans
  in accordance with the provisions of the Library Services and Technology Act (LSTA).
